"use strict"

import { isMobile } from "react-device-detect";

const image1 = new Image();
// image1.src = '/images/nicaragua750.png';
image1.src = 'data:image/jpeg;base64,'
image1.addEventListener('load', function() {

    const splashCanvas = document.getElementById('pixelEffect');
    const splashCTX = splashCanvas.getContext('2d');
    let splashWidth = []
    let splashHeight = []
    splashWidth = document.getElementById('Splash').offsetWidth;
    splashHeight = document.getElementById('Splash').offsetHeight;

    splashCanvas.width = splashWidth;
    splashCanvas.height = splashHeight;

    splashCTX.drawImage(image1, 0, 0, splashCanvas.width, splashCanvas.height);
    const pixels = splashCTX.getImageData(0, 0, splashCanvas.width, splashCanvas.height);

    let particleArray = [];
    let numberOfParticles = 700;

    if (!isMobile) {
        numberOfParticles = 2500;
    }

    let mappedImage = [];
    let cellBrightness = [];

    for (let y = 0; y < splashCanvas.height; y++) {
        let row = [];
        for (let x = 0; x < splashCanvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);

            const cell = [
                cellBrightness = brightness,
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        ) / 100;
    }


    class Particle {
        constructor() {
            this.x = Math.random() * splashCanvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 4.5;
            this.size = Math.random() * 1.5 + 1;
        }
        update() {
            this.y += this.velocity + 1;
            if (this.y >= splashCanvas.height) {
                this.y = 0;
                this.x = Math.random() * splashCanvas.width;
            }

        }
        draw() {
            splashCTX.beginPath();
            splashCTX.fillStyle = 'rgb(62, 245, 245)';
            splashCTX.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            splashCTX.fill();
        }
    }

    function initParticles() {
        for (let i = 0; i < numberOfParticles; i++) {
            particleArray.push(new Particle);
        }
    }
    initParticles();

    function animate() {
        splashCTX.drawImage(image1, 0, 0, splashCanvas.width, splashCanvas.height);

        splashCTX.globalAlpha = 0.05;
        splashCTX.fillStyle = 'rgb(0, 0, 0)';
        splashCTX.fillRect(0, 0, splashCanvas.width, splashCanvas.height);
        for (let i = 0; i < particleArray.length; i++) {
            particleArray[i].update();
            particleArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();

    // Greyscale

    // const scannedImage = splashCTX.getImageData(0, 0, splashCanvas.width, splashCanvas.height);
    // const scannedData = scannedImage.data;

    // for (let i = 0; i < scannedData.length; i += 4) {
    //     const total = scannedData[i] + scannedData[i + 1] + scannedData[i + 2];
    //     const averageColorValue = total / 3;
    //     scannedData[i] = averageColorValue;
    //     scannedData[i + 1] = averageColorValue;
    //     scannedData[i + 2] = averageColorValue;
    // }

    // scannedImage.data = scannedData;
    // splashCTX.putImageData(scannedImage, 0, 0);
});